INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", "ヒューマン", "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", 9, 102101, "観劇、おままごと", 12, 6, 9, "クルミ", 150, 40, 0, "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
