INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", "ヒューマン", "トワイライトキャラバン", "実験が趣味の危険な科学者", 13, 105101, "研究、実験", 27, 3, 7, "ミツキ", 166, 53, 0, "三石琴乃", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", "獣人族", "牧場（エリザベスパーク）", "乙女チックなもふもふアニマル", 11, 105201, "毛繕い、お喋り", 18, 3, 14, "リマ", 150, 100, 0, "徳井青空", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…");
