INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", "獣人族", "メルクリウス財団", "弱きを助け強きをくじく猫娘", 12, 107901, "猫とたわむれること", 18, 3, 1, "タマキ（サマー）", 158, 48, 0, "沼倉愛美", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", "ヒューマン", "メルクリウス財団", "仕事も私事も効率優先な傭兵少女", 12, 108001, "傭兵などのアルバイト", 20, 11, 11, "ミフユ（サマー）", 163, 49, 0, "田所あずさ", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", "魔族", "悪魔偽王国軍（ディアボロス）", "占いが得意な霊能少女", 7, 108101, "占い", 18, 12, 22, "シノブ（ハロウィン）", 157, 42, 0, "大坪由佳", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", "魔族", "悪魔偽王国軍（ディアボロス）", "プリン大好きゴースト娘", 7, 108201, "プリンを食べること", 14, 1, 23, "ミヤコ（ハロウィン）", 130, 32, 0, "雨宮天", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", "魔族", "ルーセント学院", "ちょっとおませな恋に恋する女の子", 14, 108301, "ファッション誌鑑賞、コスメ集め", 11, 1, 3, "ミサキ（ハロウィン）", 120, 22, 0, "久野美咲", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", "ヒューマン", "カルミナ", "人々を守るために歌う、唱喚士の少女", 4, 108401, "各種楽器", 17, 6, 3, "チカ（クリスマス）", 163, 46, 0, "福原綾香", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", "ヒューマン", "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", 9, 108501, "観劇、おままごと", 12, 6, 9, "クルミ（クリスマス）", 150, 40, 0, "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", "ヒューマン", "サレンディア救護院", "ぷうきちといつも一緒！", 9, 108601, "屋内でできる遊び", 14, 5, 10, "アヤネ（クリスマス）", 148, 38, 0, "芹澤優", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", "獣人族", "トゥインクルウィッシュ", "人助けが大好き！　前向き格闘娘", 2, 108701, "人助け、応援", 16, 8, 27, "ヒヨリ（ニューイヤー）", 155, 44, 0, "東山奈央", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", "ヒューマン", "トゥインクルウィッシュ", "戦闘のサポートが得意な、心優しい少女", 2, 108801, "料理、人間観察", 17, 4, 5, "ユイ（ニューイヤー）", 158, 47, 0, "種田梨沙", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", "魔族", "トゥインクルウィッシュ", "クールで何事にも真っ直ぐな剣士", 2, 108901, "読書、乗馬、お茶", 18, 1, 12, "レイ（ニューイヤー）", 163, 46, 0, "早見沙織", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", "魔族", "トワイライトキャラバン", "運命の相手に一途すぎる乙女", 13, 109001, "実験、裁縫、料理", 16, 7, 30, "エリコ（バレンタイン）", 154, 43, 0, "橋本ちなみ", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", "ヒューマン", "ラビリンス", "お姉ちゃんがお世話してあげるからねっ！", 3, 109101, "家事全般", 18, 10, 24, "シズル（バレンタイン）", 168, 54, 0, "生天目仁美", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", "ヒューマン", "？？？", "英霊と契約を結んだマナリアの天才王女", "", 109201, "読書", 17, 12, 1, "アン", 156, 55, 0, "日笠陽子", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", "ヒューマン", "？？？", "マナリア魔法学院の新入生", "", 109301, "食べること、眠ること", 15, 2, 4, "ルゥ", 144, 45, 0, "こやまきみこ", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", "半人半竜", "？？？", "人を超越した力を有す心優しい竜姫", "", 109401, "ピアノ", 17, 11, 3, "グレア", 167, 67, 0, "福原綾香", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね");
